CREATE TABLE tbase:informix.uitrp_dbs03 (
	uitrpfreg date,
	uitrpidcl smallint,
	uitrpcage integer,
	uitrptdid smallint,
	uitrpndid char(20),
	uitrpnomb char(90),
	uitrpmorg smallint,
	uitrpnopr char(20),
	uitrpntra char(20),
	uitrpncaj smallint,
	uitrppref smallint,
	uitrpcorr smallint,
	uitrpdesc char(50),
	uitrpcmon smallint,
	uitrpimpo decimal(14,2),
	uitrpcbio decimal(14,6),
	uitrpimpt decimal(14,2),
	uitrpnfor integer,
	uitrpmrcb smallint,
	uitrpplaz smallint,
	uitrpagen smallint,
	uitrpuser char(3),
	uitrphora char(8),
	uitrpfpro date,
	uitrpumrc char(3),
	uitrphmrc char(8),
	uitrpfmrc date,
	uitrpotra char(500),
	uitrpdtra char(500)
);

load FROM uitrp_dbs03.txt INSERT INTO uitrp_dbs03;

SELECT *
FROM uitrp a
WHERE a.uitrpfpro = today
AND EXISTS (SELECT *
			FROM uitrp_dbs03 b
			WHERE b.uitrpntra = a.uitrpntra
			AND b.uitrpnopr = a.uitrpnopr
			AND b.uitrpimpo = a.uitrpimpo);

SELECT *
FROM uitrp_dbs03 a
WHERE a.uitrpfpro = today
AND NOT EXISTS (SELECT *
			FROM uitrp b
			WHERE b.uitrpntra = a.uitrpntra
			AND b.uitrpnopr = a.uitrpnopr
			AND b.uitrpimpo = a.uitrpimpo);

